import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';


import { HttpClientModule, HttpClient } from '@angular/common/http';
import { TranslateModule, TranslateLoader } from '@ngx-translate/core';
import { TranslateHttpLoader } from '@ngx-translate/http-loader';


import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { M5GETListbookComponent } from './m5-get-listbook/m5-get-listbook.component';
import { M5GetAbookComponent } from './m5-get-abook/m5-get-abook.component';
import { FormsModule } from '@angular/forms';
import { M5PostCreatebookComponent } from './m5-post-createbook/m5-post-createbook.component';
import { M5PutUpdatebookComponent } from './m5-put-updatebook/m5-put-updatebook.component';
import { M3DeleteRemovebookComponent } from './m3-delete-removebook/m3-delete-removebook.component';
export function HttpLoaderFactory(http: HttpClient) {
  return new TranslateHttpLoader(http);
}
@NgModule({
  declarations: [
    AppComponent,
    M5GETListbookComponent,
    M5GetAbookComponent,
    M5PostCreatebookComponent,
    M5PutUpdatebookComponent,
    M3DeleteRemovebookComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,

    HttpClientModule,
    // TranslateModule.forRoot({
